script: |
  super -f text -I q5088.spq | sort > q5088.out

inputs:
  - name: q5088.spq
    data: |
      SELECT DISTINCT - col1 * - col0 FROM tab0 (FORMAT parquet) cor0 WHERE NOT + CAST ( NULL AS INTEGER ) + col1 * 8 BETWEEN col2 + - col0 AND 66 * CAST ( col0 * + col1 AS INTEGER ) + 41;
  - name: tab0

outputs:
  - name: q5088.out
    data: |
